import React from 'react';
import { Router } from 'react-router';
import Content from '../Components/Content.js';
import Sidebar from "../Components/Sidebar.js"

const home = () => {
    return (
        <Router>
            <div className="h-full flex">
                <Sidebar />
                <Content />
            </div>
        </Router>
    );
};

export default home;
